import React from 'react';
import shoesStore from '../../../Data/shoes.json'
import ProductItem from "./ProductItem";

function ProductList({showActionModal, showReadOnlyModal}) {
    return (
        <div className="row">
            {
                shoesStore.map((shoes) => {
                    return (
                        <ProductItem key={shoes.id} item={shoes}  action={{ showActionModal, showReadOnlyModal }} />
                    )
                })
            }
        </div>
    );
}

export default ProductList;
